import React, { useEffect, useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import CountdownTimer from './../CountdownTimer';
import NotificationButton from './../NotificationButton';
import './css/SeriesMatchesTab.css';

export default function SeriesMatchesTab() {
  const [matches, setMatches] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  const location = useLocation();
  const { stageIds = [] } = location.state || {};

  useEffect(() => {
    const fetchMatches = async () => {
      try {
        const res = await fetch(`/api/series/${stageIds.join(',')}/matches`);
        const json = await res.json();
        setMatches(json.data.data || []);
      } catch (err) {
        console.error('Error fetching series matches:', err);
      } finally {
        setLoading(false);
      }
    };

    if (stageIds.length) {
      fetchMatches();
    }
  }, [stageIds]);

  const liveMatchStatuses = [
    '1st Innings', '2nd Innings', '3rd Innings', '4th Innings',
    'Stump Day 1', 'Stump Day 2', 'Stump Day 3', 'Stump Day 4',
    'Innings Break', 'Tea Break', 'Lunch', 'Dinner', 'Int.', 'Delayed'
  ];

  const completedMatchStatuses = ['Finished', 'Cancl', 'Aban.'];
  const upcomingMatchStatuses = ['NS', 'Postp.'];
  const liveMatches = matches.filter(m => liveMatchStatuses.includes(m.status));
  const upcomingMatches = matches.filter(m => upcomingMatchStatuses.includes(m.status));
  const completedMatches = matches.filter(m => completedMatchStatuses.includes(m.status));

  const getTossWinnerName = (match) =>
    match.toss_won_team_id === match.localteam.id
      ? match.localteam.name
      : match.visitorteam.name;

  const getTossDecision = (match) =>
    match.elected === 'batting' ? 'bat first' : match.elected === 'bowling' ? 'bowl first' : '';

  const getTeamRuns = (match, teamId) => {
    const innings = (match.runs || []).filter(r => r.team_id === teamId);
    return innings.map(r => `${r.score}/${r.wickets} (${r.overs} ov)`).join(' & ');
  };

  const venueName = (match) =>
    match.venue?.name && match.venue?.city ? `${match.venue.name}, ${match.venue.city}` : 'TBD';

  return (
    <div className="match-cards-row">
      {matches.map(match => (
        <div key={match.id} className="match-card" onClick={() => navigate(`/match/${match.id}`)}>
          <div style={{ marginTop: '10px' }}>
            {match.status !== 'Finished' && <NotificationButton match={match} />}
          </div>
          <p>
            <img src={match.localteam.image_path} alt="" className="flag-icon" />
            {match.localteam.name} {getTeamRuns(match, match.localteam.id)}
          </p>
          <p>
            <img src={match.visitorteam.image_path} alt="" className="flag-icon" />
            {match.visitorteam.name} {getTeamRuns(match, match.visitorteam.id)}
          </p>
          {match.status === 'NS' && !match?.elected && (
            <CountdownTimer startTime={match.starting_at} />
          )}
          {match?.note ? (
            <p className="status">{match.note}</p>
          ) : (
            match?.toss_won_team_id && match?.elected && (
              <p>{getTossWinnerName(match)} won the toss and elected to {getTossDecision(match)}</p>
            )
          )}
          <div className="match-meta">
            <span className="venue">Venue: {venueName(match)}</span>
          </div>
          {match.id && !upcomingMatchStatuses.includes(match.status) && (
            <div className="notify-btn">
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  navigate(`/match/${match.id}`);
                }}
              >
                Scorecard
              </button>
            </div>
          )}
        </div>
      ))}
    </div>
  );
}
